import getLocationHierarchy from "./getLocationHierarchy"
import renderIndexMenu from './renderIndexMenu';
import ListItem from "./listItem"
import * as style from "../../css/light/searchList";

export default function ItemList(props) {
  const getList = (list) => {
    let container = []

    for (let i = 0; i < props.pageNumber; i++) {
      if (!list[i]) break
      container.push(list[i])
    }
    return container
  }

  const getLink = (item, profile) => {
    if (!props.link) return ""
    console.log(getLocationHierarchy(item[0].data, profile))
    // else return getLocationHierarchy(item[0].data, profile)
  }

  const renderList = (list, profile) => {
    return getList(list).map((item, i) => (
      <a
          key={`ListItem${i}`}
          href={getLink(item, profile)}
          target="_blank"
          rel="noreferrer"
          style={{textDecoration: "none", color: "inherit"}}>
        <ListItem 
          key={`${props.profile}${i}D`} 
          item1={item[0].data} 
          item2={item[1].data} 
          item3={item[2].data} 
          item4={item[3].data} 
          item5={item[4].data} 
          item6={item[5].data}
        />
      </a>
    ))
  }

  const renderListContainer = () => {
    return Object.keys(props.temp).map((profile, i) => (
      <div key={`ListContainer${i}`}>
        {renderIndexMenu(props.data, props.item, props.filteredSearch, profile)}
        {renderList(props.temp[profile], profile)}
      </div>
    ))
  }

  return (
    <div style={style.listContainerStyle}>
      {renderListContainer()}
    </div>
  )
  
}
